import React from 'react';
import './App.css';
import Header from './components/header';
import Footer from './components/footer';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Header></Header>
        <Footer></Footer>
      </div>
    </Router>
  );
}

export default App;
